import React from "react";

export const ContactPicker = ({contacts, contact, setContact}) => {

  console.log(contact)
  const pushContact = () => {
    setContact('blabla')
  }

  
  return (
    <select 
        value={contact}
        defaultValue={'No Contact Selected'}
        >
    {
    contacts.map((contact) => (
      <option value={contact.name} onInput={(contact) => setContact(contact.phone)}>{contact.name}</option>
    ))
    }
    </select>
  );
};
